import Header from "../../components/header/Header";
import "./style.css";

const Friends = () => {
  return (
    <>
      <Header page="friends" />
      <div className="friends">
        <div className="friends_left">
          <div className="friends_left_header"></div>
        </div>
        <div className="friends_right"></div>
      </div>
    </>
  );
};

export default Friends;
